package com.xiaojie.leetcode._242;

import org.junit.jupiter.api.Test;

import java.util.HashMap;
import java.util.Map;

import static org.junit.jupiter.api.Assertions.assertFalse;

/**
 * 有效的字母异位词
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的一个字母异位词。
 * 示例 1:
 * 输入: s = "anagram", t = "nagaram"
 * 输出: true
 * 示例 2:
 * 输入: s = "rat", t = "car"
 * 输出: false
 * 说明:
 * 你可以假设字符串只包含小写字母。
 * 进阶:
 * 如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？
 *
 * @author xiaojie
 * @date 2018/10/12
 */
public class Solution {

    @Test
    void test() {
        System.out.println(isAnagram2("anagram", "nagaram"));
        System.out.println(isAnagram2("rat", "car"));
        assertFalse(isAnagram("aacc", "ccac"));
        assertFalse(isAnagram2("",
                ""));
    }

    /**
     * 这个方法居然超时了。。。
     * 时间复杂度 O(n) 但是 String.replaceFirst() 方法执行太耗时了，导致一长串的那个执行两秒多
     */
    public boolean isAnagram(String s, String t) {
        if (s != null && t != null && s.length() == t.length()) {
            if (s.length() == 0) {
                return true;
            }
            for (int i = 0; i < s.length(); i++) {
                t = t.replaceFirst(String.valueOf(s.charAt(i)), "");
            }
            return t.length() == 0;
        }
        return false;
    }

    /**
     * 方法二，哈希表吧
     * 总共下来 57ms 耗时是上面方法的 1/5 吧大概
     */
    public boolean isAnagram2(String s, String t) {
        if (s != null && t != null && s.length() == t.length()) {
            if (s.length() == 0) {
                return true;
            }
            Map<Character, Integer> map = new HashMap<>();
            for (char c : s.toCharArray()) {
                if (map.containsKey(c)) {
                    map.put(c, map.get(c) + 1);
                } else {
                    map.put(c, 1);
                }
            }
            for (char c : t.toCharArray()) {
                if (map.containsKey(c)) {
                    Integer value = map.get(c);
                    if (value == 0) {
                        return false;
                    }
                    map.put(c, --value);
                } else {
                    return false;
                }
            }
            return true;
        }
        return false;
    }
}
